import React from "react";

export default function Home() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <code>UNDER DEVELOPMENT</code>
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          By Shashwat Kansal and Akshat Tripathi
        </a>
      </header>
    </div>
  );
}
